DROP TRIGGER IF EXISTS `update_apu_movs_A-U_apu_equ_originales`;
DELIMITER ;;
CREATE TRIGGER `update_apu_movs_A-U_apu_equ_originales` AFTER UPDATE ON `apu_equ_originales` FOR EACH ROW BEGIN	UPDATE `apu_originales_movs` SET objeto_codigo = NEW.codigo, valor = NEW.valor, total = (((NEW.valor * cantidad) /100) * uso) WHERE tipo = 'Equipos' AND objeto_codigo = OLD.codigo; END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_apu_movs_A-U_apu_mat_originales`;
DELIMITER ;;
CREATE TRIGGER `update_apu_movs_A-U_apu_mat_originales` AFTER UPDATE ON `apu_mat_originales` FOR EACH ROW BEGIN	UPDATE `apu_originales_movs` SET objeto_codigo = NEW.codigo, valor = NEW.valor, total = (((NEW.valor * cantidad) /100) * uso) WHERE tipo = 'Materiales' AND objeto_codigo = OLD.codigo; END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_apu_movs_A-U_apu_mo_originales`;
DELIMITER ;;
CREATE TRIGGER `update_apu_movs_A-U_apu_mo_originales` AFTER UPDATE ON `apu_mo_originales` FOR EACH ROW BEGIN	UPDATE `apu_originales_movs` SET objeto_codigo = NEW.codigo, valor = NEW.valor_scc, total = (((NEW.valor_scc * cantidad) /100) * uso) WHERE tipo = 'Mano de Obra' AND objeto_codigo = OLD.codigo; END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_presupuesto_A-U_apu_originales`;
DELIMITER ;;
CREATE TRIGGER `update_presupuesto_A-U_apu_originales` AFTER UPDATE ON `apu_originales` FOR EACH ROW BEGIN	IF NEW.codigo != OLD.codigo THEN 		UPDATE presupuesto_movs SET codigo = NEW.codigo WHERE codigo = OLD.codigo; 	END IF; END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_apu_A-U_apu_originales_movs`;
DELIMITER ;;
CREATE TRIGGER `update_apu_A-U_apu_originales_movs` AFTER UPDATE ON `apu_originales_movs` FOR EACH ROW BEGIN	DECLARE p_desp decimal(20, 2); 	DECLARE total_desp decimal(20, 2); 	DECLARE p_gast decimal(20, 2); 	DECLARE total_gast decimal(20, 2); 	DECLARE total_apu decimal(20, 2); 	DECLARE total_mat decimal(20, 2); 	DECLARE total_mo decimal(20, 2); 	DECLARE total_equ decimal(20, 2); 	DECLARE total_final decimal(20, 2); 	SELECT desperdicios INTO p_desp FROM `apu_originales` WHERE codigo = NEW.codigo; 	SELECT gastos INTO p_gast FROM `apu_originales` WHERE codigo = NEW.codigo; 	SELECT SUM(total) INTO total_apu FROM `apu_originales_movs` WHERE tipo = 'APU' AND codigo = NEW.codigo; 	SELECT SUM(total) INTO total_mat FROM `apu_originales_movs` WHERE tipo = 'Materiales' AND codigo = NEW.codigo; 	SELECT SUM(total) INTO total_mo FROM `apu_originales_movs` WHERE tipo = 'Mano de Obra' AND codigo = NEW.codigo; 	SELECT SUM(total) INTO total_equ FROM `apu_originales_movs` WHERE tipo = 'Equipos' AND codigo = NEW.codigo; 	SET total_desp := ((total_mat / 100) * p_desp); 	SET total_gast := ((total_mo / 100) * p_gast); 	IF ISNULL(total_desp) THEN SET total_desp := 0; END IF; 	IF ISNULL(total_gast) THEN SET total_gast := 0; END IF; 	IF ISNULL(total_apu) THEN SET total_apu := 0; END IF; 	IF ISNULL(total_mat) THEN SET total_mat := 0; END IF; 	IF ISNULL(total_mo) THEN SET total_mo := 0; END IF; 	IF ISNULL(total_equ) THEN SET total_equ := 0; END IF; 	SET total_final := total_desp + total_gast + total_apu + total_mat + total_mo + total_equ; 	UPDATE `apu_originales` SET valor = total_final WHERE codigo = NEW.codigo; END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_groups_A-U_originales`;
DELIMITER ;;
CREATE TRIGGER `update_groups_A-U_originales` AFTER UPDATE ON `par_presupuesto_grupo_originales` FOR EACH ROW BEGIN	IF NEW.codigo != OLD.codigo THEN BEGIN 		IF NEW.categoria = 'APU' THEN 			UPDATE `apu_originales` SET codigo = CONCAT(NEW.codigo, '.', subgrupo, '.', codigo2), grupo = NEW.codigo WHERE grupo = OLD.codigo; 		END IF; 		IF NEW.categoria = 'Materiales' THEN 			UPDATE `apu_mat_originales` SET codigo = CONCAT(NEW.codigo, '.', subgrupo, '.', codigo2), grupo = NEW.codigo WHERE grupo = OLD.codigo; 		END IF; 		IF NEW.categoria = 'Equipos' THEN 			UPDATE `apu_equ_originales` SET codigo = CONCAT(NEW.codigo, '.', subgrupo, '.', codigo2), grupo = NEW.codigo WHERE grupo = OLD.codigo; 		END IF; 		IF NEW.categoria = 'Mano de Obra' THEN 			UPDATE `apu_mo_originales` SET codigo = CONCAT(NEW.codigo, '.', subgrupo, '.', codigo2), grupo = NEW.codigo WHERE grupo = OLD.codigo; 		END IF; 		UPDATE `par_presupuesto_subgrupo_originales` SET grupo = NEW.codigo WHERE grupo = OLD.codigo AND categoria = OLD.categoria; 	END; END IF; END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `update_subgroups_A-U_originales`;
DELIMITER ;;
CREATE TRIGGER `update_subgroups_A-U_originales` AFTER UPDATE ON `par_presupuesto_subgrupo_originales` FOR EACH ROW BEGIN	IF NEW.codigo != OLD.codigo THEN BEGIN 		IF NEW.categoria = 'APU' THEN 			UPDATE `apu_originales` SET codigo = CONCAT(grupo, '.', NEW.codigo, '.', codigo2), subgrupo = NEW.codigo WHERE grupo = OLD.grupo AND subgrupo = OLD.codigo; 		END IF; 		IF NEW.categoria = 'Materiales' THEN 			UPDATE `apu_mat_originales` SET codigo = CONCAT(grupo, '.', NEW.codigo, '.', codigo2), subgrupo = NEW.codigo WHERE grupo = OLD.grupo AND subgrupo = OLD.codigo; 		END IF; 		IF NEW.categoria = 'Equipos' THEN 			UPDATE `apu_equ_originales` SET codigo = CONCAT(grupo, '.', NEW.codigo, '.', codigo2), subgrupo = NEW.codigo WHERE grupo = OLD.grupo AND subgrupo = OLD.codigo; 		END IF; 		IF NEW.categoria = 'Mano de Obra' THEN 			UPDATE `apu_mo_originales` SET codigo = CONCAT(grupo, '.', NEW.codigo, '.', codigo2), subgrupo = NEW.codigo WHERE grupo = OLD.grupo AND subgrupo = OLD.codigo; 		END IF; 	END; END IF; END
;;
DELIMITER ;
